import React, { Component } from 'react';
//import { ReactComponent as Logo } from '../img/logo.png';
import logo from '../img/logo.png';
import "./Header.css";
import { Link } from "react-router-dom";
import SearchIcon from "@material-ui/icons/Search";
import PeopleIcon from '@material-ui/icons/People';
//import db from '../firebase';
import { auth, provider, user } from '../firebase';
function Header() {
    function googleSignUp() {
        auth.signInWithPopup(provider);
    }
    return (
        <nav className="header">
            <Link to="/">
                <img src={logo} alt="logo image" className="header__logo" />
                {/* <Logo className="header__logo" /> */}
            </Link>
            <div className="header__search">
                <input type="text" className="header__searchInput" />
                <SearchIcon className="header__searchIcon" />
            </div>
            <div className="header__nav">
                <div className="header__option" onClick={googleSignUp}>
                    <span className="header__optionLineOne">Hello</span>
                    <span className="header__optionLineTwo">{user} <PeopleIcon className="header__optionLineTwo" /></span>
                </div>
            </div>
        </nav >
    )
}

export default Header
